<style>
    body{
        background-color: black;
        display:flex;
        flex-direction: row;
        align-items: center;
        justify-content: center;
        padding:0;
        margin:0px;
        height:300vh;
    }

    ::-webkit-scrollbar{display:none}


    .lens,.E {
        animation : enlarge alternate ease-in-out;
        animation-timeline: scroll();
    }

    @keyframes enlarge {
        from{transform:scale(1)  rotateZ(0)}
        
        to{transform:scale(9) rotateZ(291deg);}
    }


    .A {
        animation : enlargeA alternate ease-in-out;
        animation-timeline: scroll();
    }

    @keyframes enlargeA {
        from{transform:scale(1)  rotateZ(0)}
        20%{transform:scale(1.2)  rotateZ(76.4deg);opacity:0.4}

        55%,to{transform:scale(0) rotateZ(-91deg); opacity:0}
    }

    @keyframes enlargeAs {
        from{transform:scale(1)  rotateZ(0)}
        36%,100%{transform:scale(0) rotateZ(0deg); opacity:0}
    }

    .frame{
        animation : enlargeAs alternate ease-in-out;
animation-timeline: scroll();
    }

    .lens circle {
        animation : change alternate ease-in-out;
        animation-timeline: scroll();
    }

    @keyframes change {
        from {   fill-opacity: 0.34;}
        50% { fill:rgb(0,0,0) ; fill-opacity: 1;}
        78%,100%{fill-opacity:0;}
    }
</style>
